import React from "react";
import './maisvendidos.css';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import macarrao from '../../imagens/Prato de macarrão.png';

const slides = [
    {
      image: "image1.jpg",
      title: "Prato 1",
      description: "Descrição do Prato 1"
    },
    // {
    //   image: "image2.jpg",
    //   title: "Prato 2",
    //   description: "Descrição do Prato 2"
    // },

];


function MaisVendidos(){
    return (
        <section className="sec5__maisVendidos">
            <h2>Pratos mais vendidos</h2>
                <Swiper
                    spaceBetween={50}
                    slidesPerView={3}
                    onSlideChange={() => console.log('slide change')}
                    onSwiper={(swiper) => console.log(swiper)}
                    >
                        
                    {slides.map((slide, index) => (
                        <SwiperSlide key={index} className="sec5__slide">
                            <img src={macarrao} className="slide__imagem"></img>
                            <div className="container__slide">
                                <h3>Espaguete com camarão</h3>
                                <h4>Suculentos camarões com infusão de manteiga e alho escaldantes em um saboroso molho de creme, misturados com macarrão perfeitamente cozido.</h4>
                                <p>Olive Garden</p>
                                <a href="#">Saiba mais</a>
                            </div>
                        </SwiperSlide>
                    ))}
                </Swiper>
        </section>
    )
}

export default MaisVendidos;
